import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { AuthContext } from '../contexts/AuthContext';

function Navbar() {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  return (
    <nav className="bg-gray-800 p-4">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-white text-xl font-bold">Blog App</h1>
        <div className="space-x-4">
          {user ? (
            <>
              <a href="/blogs" className="text-white hover:text-gray-300">Blogs</a>
              <a href="/my-blogs" className="text-white hover:text-gray-300">My Blogs</a>
              <a href="/create-blog" className="text-white hover:text-gray-300">Create Blog</a>
              <button
                onClick={() => {
                  logout();
                  navigate('/login');
                }}
                className="text-white hover:text-gray-300"
              >
                Logout
              </button>
            </>
          ) : (
            <>
              <a href="/login" className="text-white hover:text-gray-300">Login</a>
              <a href="/signup" className="text-white hover:text-gray-300">Signup</a>
            </>
          )}
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
